import { StatusBar } from 'expo-status-bar';
import * as React from 'react';
import { StyleSheet, Text, View, Image, SafeAreaView, ScrollView, Dimensions, ImageBackground, } from 'react-native';
import { Header, Icon, Button, Chip, Card, ListItem, ViewPagerAndroid, PricingCard } from "react-native-elements";
import { SafeAreaProvider } from "react-native-safe-area-context";


export default function App() {

  console.log("App Executed!");
  const [index, setIndex] = React.useState(0);
  return (
    <SafeAreaProvider style={styles.container}>
    <ScrollView style={styles.scrollView}>
    <Header
      barStyle="default"
      centerComponent={{
        text: "  SMART PARKING",
        style: { color: "#fff" }, 
      }}
      centerContainerStyle={{}}
      containerStyle={{ width: Dimensions.get('window').width - 2 }}
      leftComponent={{ icon: "menu", color: "#fff" }}
      placement="center"
    />
      <View style={styles.top_out}>
          <View style={styles.top}>
          <ImageBackground  style= { styles.backgroundImage } source={require('./assets/bg1.png')} >
            <Chip

              title=" SEARCH     "
              titleStyle={{
              color: "white",
              fontSize: 16,
              fontWeight: "bold",
              }}

              loadingProps={{ animating: true }}
              onPress={() => alert("clicked search!")}
              icon={{
              name: "place",
              type: "material",
              size: 25,
              color: 'white',
              padding: 10,
              }}
            />
          </ImageBackground>
          </View>

          <View style={{ height: 5,}} />
        </View>
        <Card>
          <Card.Title style = {{ color: "#4181f0",fontVariant: "bold", }} >MY SLOTS</Card.Title>
          <Card.Divider/>

          <Card.Image source={require('./assets/icon.png')}></Card.Image>
          <Text style={{marginBottom: 10}}>
            The idea with React Native Elements is more about component structure than actual design.
          </Text>
          <Button
            icon={{
              name: "dollar",
              type: "font-awesome",
              size: 15,
              color: 'white',
              padding: 10,
            }}
            buttonStyle={{borderRadius: 0, marginLeft: 0, marginRight: 0, marginBottom: 0}}
            title='PAY NOW' />

        </Card>
        <PricingCard
  color="#4f9deb"
  title="BOOKED"
  price="$00.00"
  info={['Id : 120391', 'Ace Mall, Northwest Street, Thanjavur.', 'All Core Features']}
  button={{ title: 'PAY NOW', icon: 'dollar', type: 'font-awesome' }}
/>;

    <StatusBar style="auto" />
    </ScrollView>
    </SafeAreaProvider>
  );
}

const styles = StyleSheet.create({

  container: {
    backgroundColor: "#f2f5fa",
  },

  top_out: {
    paddingTop: 20,
    alignSelf: "center",
  },

  top: {
    shadowColor: "#000",
    shadowOffset: {
	  width: 0,
	  height: 10,
  },
    shadowOpacity: 0.53,
    shadowRadius: 13.97,
    elevation: 21,
    width: (Dimensions.get('window').width - 70),
    height: 180,
    backgroundColor: "white",
    borderTopLeftRadius: 20,
    borderTopRightRadius: 20,
    borderBottomLeftRadius: 20,
    borderBottomRightRadius: 20,

  },

  backgroundImage:{
    flex: 1,
    width: '100%',
    height: '100%',
    justifyContent: "center",
    alignItems: "center",
    opacity: 1
},

});
